import React from 'react';

const button = (props) => {

    const buttonStyle = {
        backgroundColor: '#483D53',
        border: 'none',
        padding: '20px 40px',
        width: '250px',
        marginTop: '5%',
        marginRight:'2%',
        cursor: 'pointer',
        color: '#FFFFFF',
        textDecoration: 'none',
        letterSpacing: '2px',
        fontSize: '20px',
        textAlign: 'center',
        display: 'inline-block',
    }

    const buttonAlign={
        display: 'inline'
    }

    return (
        <div style={buttonAlign} >
            <button style={buttonStyle}>
                {props.name}
            </button>
        </div>
    )
}

export default button
